import React, { useState } from "react";
import cn from "classnames";
import styles from "./Changer.module.sass";
import Flow_Steps from "../../../Flow_Steps";
import Modal from "./Modal";

const Transfer = ({ className }) => {
  const [visibleModalPurchase, setVisibleModalPurchase] = useState(false);
  return (
    <>
    <div className={cn(className, styles.transfer)}>
      <div className={cn("h4", styles.title)}>Transfer token</div>
      <div className={styles.text}>
      NEW PRICE
      </div>
      <div className={styles.field}>
        <input
          className={styles.input}
          type="text"
          name="address"
          placeholder=""
        />
      </div>
      <div className={styles.btns}>
        <button className={cn("button", styles.button)}>Changer price</button>
        <button className={cn("button-stroke", styles.button)}>Cancel</button>
      </div>
    </div>
     <Modal
     visible={visibleModalPurchase}
     onClose={() => setVisibleModalPurchase(false)}
   >
     <Flow_Steps />
   </Modal>
 </>
  );
};

export default Transfer;
